import logo from './logo.svg';
import './App.css';
import Grid from '@material-ui/core/Grid';
import AnchorLink from 'react-anchor-link-smooth-scroll';
import Profile from './Profile.js';
import picSelvIkei from './imgs/picSelvIkei.jpeg';
//import picOpaaco from './static/media/picOpaaco.jpeg';
//import picCasulo from '.static/media/picCasulo.jpeg';
import Project from './Project.js'

function Main() {
  const bioMiguel = "Maker autodidacta e investigador del error. safaf";
  const bioSelvIkei = "";
  const bioOpaaco= "";
  const bioCasulo= "";

  return (
    <div>
    <Grid item xs={12}>
      <Grid container>
          <Grid xs={2} item>
            <p><a href="#selv_ikei">Selv Ikei</a></p>
            <p><a href="#opaaco">Opaaco</a></p>
            <p><a href="#casulo">Casulo</a></p>
          </Grid>
          <Grid xs={2} item>
            <div id="personas_projects">
            </div>
          </Grid>
          <Grid xs={8} item>
            <Profile
            name="Miguel Zurk Cruz"
            picture={picSelvIkei}
            bio={bioMiguel} />

          </Grid>
      </Grid>
    </Grid>
    </div>
  );
}

export default Main;
